import { useEffect, useState } from "react"
import { deleteWorksheetFromDatabase, fetchUserWorksheets } from "./services/worksheetServices"
// import { fetchUserStudents } from './services/studentServices'
import { useNavigate } from "react-router-dom"

export const Worksheets = ({ user }) => {

    // const [students, setStudents] = useState([])
    const [worksheets, setWorksheets] = useState([])

    const navigate = useNavigate()

    const handleDeleteButton = (event, id) => {
        event.preventDefault()
        deleteWorksheetFromDatabase(id).then(() => {
            handleWorksheetsFetchCall()
        })
    }

    const handleWorksheetsFetchCall = () => {
        fetchUserWorksheets(user.id).then((data) => {
            setWorksheets(data)
        })
        // fetchUserStudents(user.id).then((data) => {
        //     setStudents(data)
        // })
    }

    useEffect(() => {
        handleWorksheetsFetchCall()
    }, [user.id])

